import { SET_OBRA_SOCIAL, SET_LISTA_OBRA_SOCIAL } from "../actions/types";

export function setObraSocial() {
  //Set de la obraSocial que quiero editar
  return (dispatch) => {
    dispatch({
      type: SET_OBRA_SOCIAL,
      payload: obrasSocial,
    });
  };
}
